import React from 'react';
import { Container, Row, Col ,Navbar, Nav, NavDropdown, Image, Button } from 'react-bootstrap';

import SignImage from '../../assets/images/sign.png'; 

import './styles.css';

function Sign() {
  return (
    <Container>
      <Row>
        <Col xs={12}>
          <Image src={SignImage} />
        </Col>
      </Row>
   </Container>
  );
}

export default Sign;
